import React from 'react';


const output = '> lambda({x} -> x) \n 5'

class OutputConsole extends React.Component {

	state = { output }

	render() {
		return (
			<div className="console-out">
				{this.state.output}
			</div>
			);
	}
}

export default OutputConsole
